import React from 'react';
import { Col, Row } from 'antd';
import { MenuFoldOutlined, SearchOutlined, FilmOutlined } from '@ant-design/icons';

const MovieHeaderComponent = () => {
  return (
    <>
      <Row style={{
          borderBottom: '1px solid #d3d3d3',
          height: '64px',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center'
      }}>
          <Col span={6} style={{ textAlign: 'left' }}><MenuFoldOutlined /></Col>
          <Col span={12} style={{ fontWeight: 'bold' }}>CINEMAX</Col>
          <Col span={6} style={{ textAlign: 'right' }}><SearchOutlined /></Col>
      </Row>
      <Row style={{
          padding: '0 20px',
          color: '#d3d3d3'
      }}>
          <Col span={24} style={{ textAlign: 'center' }}><FilmOutlined /> Discover New Movies</Col>
      </Row>
    </>
  )
}

export default MovieHeaderComponent;
